import React, { Component } from 'react';
import './Vasilis.css';
import profilePicture from './me-drawing.png';

class Vasilis extends Component {
  scrollFunction = () => {
    console.log('done');
  }
  render() {
    return (
      <div className="vasilis" onwheel={this.scrollFunction}>
        <img src={profilePicture} className="main__picture"></img>
      </div>
    );
  }
}

export default Vasilis;
